import './App.css';
import React from 'react';

import FormInput from './components/FormInput';
import TodoList from './components/TodoList';


function App() {
  const [input, setInput] = React.useState("")
  const [list, setList] = React.useState([])

  return (
    <div className="App">
      <header>
        <h1>Tomiwa's todo list</h1>
      </header>
      <FormInput 
        input={input}
        setInput={setInput}
        list={list}
        setList={setList}
      />
      <TodoList 
        list={list}
        setList={setList}
      />
      {input}
    </div>
  );
}

export default App;
